import React from 'react';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import './App.css';

class App extends Component{
  render(){
    return(
      <React.Fragment>
        <Router>
          <Switch>
            <Router exact path="/" component={Home}/>
            <Router exact path="/aircrafts" component={Aircrafts}/>
            <Router exact path="/airlines" component={Airlines}/>
            <Router exact path="/airports" component={Airports}/>
            <Router exact path="/about" component={About}/>
            <Router component={NoMatch}/>
          </Switch>
        </Router>
      </React.Fragment>
    )
  }
}

export default App;
